import React, { useContext, useEffect, useState } from "react";
import { UserContext } from "../App";
import { Form } from "react-bootstrap";
import CustomTable from "../components/CustomTable";

export default function Completed() {

    const countries = [
        { label: "India", value: "IN" },
        { label: "US", value: "US" },
        { label: "Germany", value: "DE" }
    ]

    const [countryData, setCountryData] = useState([]);
    const [country, setCountry] = useState();

    useEffect(() => {
        fetch("https://api.postalpincode.in/pincode/110001")
            .then((res) => {
                if (!res.ok) {
                    console.log(res.status);
                }
                return res.json()
            }) // get response object and convert to JSON
            .then((actualData) => console.log(actualData[0].PostOffice))
            .catch(console.log("couldn't fetch data")) // catch error
    }, []);

    return (
        <div className="outlet">
            <div className="d-flex align-items-center m-3">
                <div className="d-flex align-items-center">
                <label>Select Country</label>
                <Form.Select defaultValue={"Pending"}
                    style={{ "marginLeft": "5px", marginRight: "5px", width: "150px" }}
                    onChange={(e) => setCountry(e.target.value)}>
                    {
                        countries.map(country => {
                            return <option value={country.value}>{country.label}</option>
                        })
                    }
                </Form.Select>
                </div>
            </div>

            <CustomTable classnames={["table", "shadow", "align-items-center", "w-60"]}
                data={countryData}
                apiCall={true}
                headers={["PlaceNamde", "Latitude", "State"]}
                columns={["Name", "BranchType", "District", "state"]}>
            </CustomTable>
        </div>
    )
}
